import React from 'react';
import ReactDOM from 'react-dom';
import './ApplicantInfo.css';

class ApplicantInfo extends React.Component {
	constructor(props){
		super(props);
		this.state = {
				name: "Almir Omerovic",
				placeOfEmployment: "DCCS, Tuzla",
				addres: "Moluhe,7500 Tuzla",
				};
	}
	render(){
		return(
		  <div>
		    <p>{this.state.name}</p>
		    <p>{this.state.placeOfEmployment}</p>
		    <p>{this.state.addres}</p>
		  </div>
		);
	}
} 

export default ApplicantInfo;
